import React from 'react'

import './index.less'

import check from '@misc/logo/asset9.svg'

class LeaveSession extends React.PureComponent {
  render() {
    return (
      <div className='leave-session'>
        <img src={check} alt='icon' />
        <p>Bạn đã rời phiên và có thể đóng cửa sổ.</p>
      </div>
    )
  }
}

export default LeaveSession
